import * as React from "react";
import ReactDOM from "react-dom/client";
import {
  createRoutesFromElements,
  createBrowserRouter,
  RouterProvider,
  Route,
  Outlet,
} from "react-router-dom";
import HomePage from "./components/HomePage";
import SecondPage from "./components/SeconPage";
import MainContainer from "./components/Containers/MainContainer";

let Title1: string = "Welcome";
let Title2: string = "About me";
let SubTitle1: string = "I am Ryad Laouedj";
let SubTitle2: string = "My journet with code";
let Text1: string = "Creative developer & student at 42 Paris. Between Design & Code I try to create intuitive interfaces for user through a Logic & Organized based code.";
let Text2: string = "Lorem ipsum dolor";

const Root = () => {
  return (
    <div>
      <MainContainer title={Title} subtitle={SubTitle} text={Text} />
      <MainContainer title="oui" subtitle="oui" text="oui" />
    </div>
  );
};

// Configure nested routes with JSX
const router = createBrowserRouter(
  createRoutesFromElements(
    <Route path="/" element={<Root />}>
      <Route path="/Homepage" element={<HomePage />} />
      <Route path="/Seconpage" element={<SecondPage />} />
    </Route>
  )
);

const root = ReactDOM.createRoot(
  document.getElementById("root") as HTMLElement
);

root.render(<RouterProvider router={router} />);
